                <form class="d-flex" role="search">
                    <input class="form-control me-2" type="search" placeholder="Search" aria-label="Search">
                    <button class="btn btn-outline-success" type="submit">搜索</button>
                </form>

                <button type="button" class="btn btn-primary loginin" data-bs-toggle="modal" data-bs-target="#staticBackdrop"
                    style="width: 60px; height: 60px; background-color: gainsboro; border: none; font-family: 华文彩云; font-size: 13px; margin-right: 30px; border-radius: 50%;">
                    登录<br>注册
                </button>

                <button type="button" class="btn btn-primary loginout" style="display: none;">

                    退出登录
                </button>


                <!-- Modal -->
                <div class="modal fade" id="staticBackdrop" data-bs-backdrop="static" data-bs-keyboard="false"
                    tabindex="-1" aria-labelledby="staticBackdropLabel" aria-hidden="true">
                    <div class="modal-dialog">
                        <div class="modal-content"
                            style="background-position: center; background-repeat: no-repeat; background-size: cover;">
                            <div class="modal-header">
                                <h1 class="modal-title fs-5" id="staticBackdropLabel">登录/注册</h1>
                                <button type="button" class="btn-close" data-bs-dismiss="modal"
                                    aria-label="Close"></button>
                            </div>
                            <div class="modal-body">
                                <form action="">
                                    <label>账号： </label>
                                    <input type="text" id="username">
                                    <br>
                                    <br>
                                    <label>密码： </label>
                                    <input type="text" id="password">
                                    <br>
                                    <br>
                                    自动创建账号
                                    <label for="fileInput"
                                        style="display: block; padding: 10px; background-color: #f0f0f0; border: 1px solid #ccc; cursor: pointer;">
                                        点击这里上传头像
                                        <input type="file" name="fileInput" id="fileInput" style="display: none;">
                                    </label>
                                </form>
                            </div>
                            <div class="modal-footer">
                                <button type="button" class="btn btn-secondary liveToastBtn" id="dl">登录/注册</button>
                                <button type="button" class="btn btn-secondary" id="forpasswrod">忘记密码</button>
                            </div>
                        </div>
                    </div>
                </div>


            </div>
        </div>
    </nav>

    <!-- 右下角弹窗 -->
    <div class="toast-container position-fixed bottom-0 end-0 p-3">
        <div id="liveToast" class="toast" role="alert" aria-live="assertive" aria-atomic="true">
            <div class="toast-header">
                <img class="rounded me-2" alt="..." style="width: 50px; height: 50px;">
                <strong class="me-auto" id="tipname"></strong>
                <small id="toptime"></small>
                <button type="button" class="btn-close" data-bs-dismiss="toast" aria-label="Close"></button>
            </div>
            <div class="toast-body">
                欢迎回来！
            </div>
        </div>
    </div>
    <style>
        .nav-item {
            margin-right: 40px;
        }

        .nav-link {
            font-family: 华文彩云;
        }

        .btn-outline-success {
            width: 100px;
        }

        .btn-outline-success {
            outline: none;
        }

        .menu {
            width: 60px;
            height: 60px;
        }

        .modal-backdrop {
            display: none !important;
        }
    </style>

    <script>
        // 隐藏模态框背景遮罩
        $('#myModal').modal({ backdrop: false });

        var token = localStorage.getItem("token")

        if (localStorage.getItem("token") != "") {
            $.post(
                "user/getinfo",
                {
                    token: token
                },
                function (data) {
                    if (data.code == 200) {
                        $(".loginout").css("display","block")
                        $(".loginin").css("background-position", "center")
                        $(".loginin").css("background-size", "cover")
                        $(".loginin").html("")
                        $(".loginin").removeAttr("data-bs-target")
                        $(".loginin").css("background-image", "url('"+ data.msg.imgsrc + "')")
                        const toastTrigger = $('.liveToastBtn')
                        const toastLiveExample = $('#liveToast')
                        if (toastTrigger) {
                            const toast = new bootstrap.Toast(toastLiveExample)
                            $(".rounded").attr("src", data.msg.imgsrc)
                            $("#tipname").text(data.msg.username)
                            let date = new Date()
                            $("#toptime").text(date.getHours() + ":" + date.getMinutes() + ":" + date.getSeconds())
                            toast.show()
                        }
                    } else {
                        localStorage.removeItem("token")
                        $(".loginout").css("display","none")
                        $(".loginin").html("登录<br>注册")
                        $(".loginin").attr("data-bs-target", "#staticBackdrop")
                    }
                }
            )
        }

        $(function () {

            var formda = new FormData();

            $(".loginout").click(function (){
                localStorage.removeItem("token")
                window.location.href="./index.html"

            })

            // 使用jQuery的方法绑定change事件
            $('#fileInput').change(function () {
                const files = this.files; // 原生DOM对象的files属性
                const fileURL = URL.createObjectURL(files[0]); // 创建文件URL
                formda.append('fileInput', files[0])
                $(".modal-content").css("backgroundImage", `url(${fileURL})`);
            });

            $("#forpasswrod").click(function () {
                alert("请联系管理员")
            })

            $("#dl").click(function (event) {
                event.preventDefault()
                register()
            })


            function register() {
                $.post(
                    "user/isRegister",
                    {
                        username: $("#username").val()
                    },
                    function (data) {

                        if (data.code == 200) {
                            $.post(
                                "user/register",
                                {
                                    username: $("#username").val(),
                                    password: $("#password").val()
                                },
                                function (data) {
                                    if (data.code == 200) {
                                        //上传头像
                                        localStorage.setItem("token", data.token)
                                        $.ajax({
                                            url: 'api/upload-url',
                                            type: 'POST',
                                            data: formda,
                                            processData: false,
                                            contentType: false,
                                            beforeSend: function (xhr) {
                                                var token2 = localStorage.getItem('token');
                                                xhr.setRequestHeader('token', token2);
                                            },
                                            success: function (response) {
                                                console.log(response);
                                                window.location.href="./index.html"
                                            },
                                            error: function (xhr, status, error) {
                                                console.error('Error:', error);
                                            }
                                        });

                                    } else {
                                        alert(data.msg)
                                    }
                                }
                            )

                        } else {
                            $.post(
                                "user/login",
                                {
                                    username: $("#username").val(),
                                    password: $("#password").val()
                                },
                                function (data) {
                                    if (data.code == 200) {
                                        localStorage.setItem("token", data.token)
                                        window.location.href = "./index.html"
                                    } else {
                                        alert(data.msg)
                                    }
                                }
                            )

                        }
                    }
                )



            }



        });


    </script>
